MongoDB: return just the document from an array that matches a certain query (JS)<p>I have a MongoDB collection in the form of:</p>
<pre><code>users: {
    {
        user_id: 1000,
        activities: [
           {id: 1, activity: 'swimming'},
           {id: 2, activity: 'running'},
           {id: 3, activity: 'biking'},...
        ]
    },...
}
</code></pre>
<p>and I want to get the activity document that matches a specific ID. For example, if I query using <code>{id: 1}</code>, I want an output of <code>{id: 1, activity: 'swimming'}</code>. Currenlty, I'm trying to use <code>findOne({activities: {$elemMatch: {id: 1}}})</code>, but it returns the entire user document (the user id, and all the activities).</p>
<p>The code I'm using is:</p>
<pre><code>id = req.body.queryID;
db.collection('users').findOne({activities: {$elemMatch: {id}}})
    .then((document) =&gt; {
        console.log(document);
        // more code after this
    });
</code></pre>
<p>I've also tried to query using <code>aggregate()</code> and <code>findOne({}, {activities: {$elemMatch: {id}}})</code>, but I haven't been able to figure it out.</p>
<p>I am on MongoDB version 4.4.8 according to <code>db.version()</code>. Any help is appreciated!</p>

