}
</code></pre>
<p>And I need faster solution to extract all subdocuments _aId, sId &amp; _pid for language:&quot;CA&quot; &amp; format:&quot;A4&quot; for documents with &quot;_a._p._pid.CC&quot;:&quot;CA&quot;</p>
